import styled from 'styled-components';

export const Container = styled.div`
  button {
    display: flex;
    height: 1rem;
    width: 1rem;
    align-items: center;
    justify-content: center;
    background: transparent;
    border: solid 1px #000;
    border-radius: 100px;
    padding: 0.3rem;
    color: #000;
  }
  p {

  }
`;
